INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('8008843128273', 'Diurerbe Forte pocket drink', 'DIURERBE FORTE Integratore alimentare di estratti vegetali, con Potassio e Magnesio. Il Magnesio contribuisce all\'equilibrio elettrolitico. Gli estratti vegetali in esso contenuti sono utili per favorire l\'eliminazione dei liquidi in eccesso. Ingredienti: acqua depurata, stabilizzante: glicerolo; Ginepro (Juniperus Communis L.)semi estratto idroglicerico D/E 1/2; acidificante: acido citrico; glicerofosfato di Magnesio; citrato di Potassio; Thè verde (Camellia sinensis L. Kuntze) foglie estratto idroglicerico D/E 1/2; Ananas (Ananas Comosus L. mer.) frutto e.f. (1,52%); colorante: caramello; Verga d\'oro (Solidago virga aurea L.) erba con fiori estratto idroglicerico D/E 1/2; Betulla (Betula pendula Roth. et Betula pubescens Ehrh.) foglie e.s. tit 2,5% flav. tot.come iperoside, Pilosella (Hieracium pilosella L.) erba e.s. tit 1% vitexina; addensante: farina di semi di guar; Ortosiphon (Orthosiphon stamineus Benth.) foglie e.s. tit 0,25% sinensetina; aromi naturali; conservanti: sorbato di potassio e benzoato di sodio; Equiseto (Equisetum arvense L.) erba e.s. tit 2% silice. Modalità d\'uso: diluire 1 pocket drink in una bottiglia da 0,5 litri di acqua consumare nell\'arco della giornata. É possibile ripetere l\'assunzione 2 volte al giorno. Avwertenze: Tenere fuori dalla portata dei bambini di età inferiore ai tre anni. Non superare la dose giornaliera consigliata. Gli integratori non vanno intesi come sostitutdi una dieta variata ed equilibrata e di un sano stile di vita. Un consumo eccessivo può avere effetti lassativi. Non assumere in gravidanza. Essendo un prodotto naturale, eventuali variazioni di colore o gusto da un lotto all\'altro non ne pregiudicano la qualità. per dose massima giornaliera (40 ml) per 100 ml %VNR (40 ml) CONTENUTI MEDI Betulla e.s. tit. 2,5% di cui Betula pendula Betula pubescens apporto flav. come iperoside Pilosella e.s. tit. 1% di cui vitexina Verga d\'oro estr. idroglicerico 1/2 Ortosiphon e.s. tit. 0,25% di cui sinensetina The verde estr. idroglicerico 1/2 Ginepro estr. idroglicerico1/2 Ananas frutto e.f. Equiseto e.s. 2% di cui silice Potassio Magnesio 0,3 g 0,75 g 0,15 g 0,15 g 0,0076 g 0,25 g 0,0024 g 0,4g 0,1 g 0,00025 g 0,8 g 1,2 g 0,608 g 0,05 g 0,001 g 300 mg 112,5 mg 0,375 g 0,375 g 0,019 g 0,63 g 0,006 g 1g 0,25 g 0,0006 g 2 g 3 g 1,52 g 0,125 g 0,0025 g 750 mg 281,25 mg 15 30 VNR: Valori Nutritivi di Riferimento INTEGRATORE ALIMENTARE NON È UN MEDICINALE Prodotto incluso nel Registro degli Integratori del Ministero della Salute Codice n° 70510 b3', 'https://static.openfoodfacts.org/images/products/800/884/312/8273/front_it.15.400.jpg', '', '', '', '', '', '', '', '', '', '1');

