INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('8009736818882', 'Risotto 4 fromages', 'riz Carnaroli 85%, fromages déshydrates (en proportion variable) 11% (emmental, parmesan, Zola, pecorino, lactosérum)ï assaisonnement aux légumes (sel, fécule de pomme de terre, extrait de levure, maltodextrine de pomme de terre, légumes déshydratés: oignon - carotte - céleri - persil, huile de tournesols gingembrey noix de muscade, arômes naturels)$ oignon déshydraté, SANS GLUTEN Allergènes: céleri/lait A consommer après cuisson. Conditionné sous atmosphère protectrice, A conserver à l\'abri de la chaleur, de la lumière et de l\'humidité. A consommer de préférence avant le / numéro de lot: voir marquage sur le côté. CONSEILS DE PRÉPARATION Pour la préparation de ce risotto il faut : de l\'huile d\'olive, du vin blanc, de Portez 1..5 litre d\'eau à ébullition, Dans une poêle, faites chauffer à feu vif 2 à 3 ?ü!jières d\'huile d\'olive et faites revenir le riz pendant quelques secondes, le temps le riz devienne légèrement transparent et s\'imprègne de l\'huile. Ajoutez un demi-\' de vin blanc sec que vous laisserez évaporera Toujours sur feu vif, ajoutez ensuit par petite quantité, de l\'eau bouillantq puis laissez évaporer et ainsi de suite jusqu\'à votre riz soit moelleux (comptez environ 25 minutes), A la fin de la cuisson, ajoutez du parmesan râpé puis assaisonnez à votre Servez votre risotto en accompagnement de vos viandes ou d\'une salade PREPARATO PER RISOTTO CON 4 FORMAGGI Ingredienti: riso Carnaroli 85%, formaggi disidratati (in proporzione variabile (emmental, parmesan, zola, pecorino), siero di latte, condimento vegetale(sa di patate, estratto di lievito, maltodestrine di patate, verdure disidratate: cipolla sedano-prezzemolo, olio di girasole, zenzero, noce moscata; aromi naturalj), cipoiïa disidratata, SENZA GLUTINE Allergeni: sedano/latte Prodotto da consumare previa cottura. Confezionato in atmosfera protettiva. Conservare al riparo dal calore, dalla luce e dalla umidità. Da consumarsi preferibilmente entro il/ no lotto: vedere lato del sacchetto.', 'https://static.openfoodfacts.org/images/products/800/973/681/8882/front_fr.4.400.jpg', '3', '0.5', '68', '1.7', '', '5.9', '2', '0.78740157480315', '', '0');

